import React from 'react';
import img from '../assets/IMG-20220505-WA0006.jpg';
import './ImageProj.css'; // Assuming you have a CSS file for styles

const ImageProj = () => {
  return (
    <div className="image-proj">
      <h1>Image Project</h1>
      <img src={img} alt="Description of the image" className="proj-image" />
    </div>
  );
};

export default ImageProj;
